    "user/findUserPrivacity": "<ul class=\"nav nav-tabs\">\n  <li role=\"presentation\">\n    {{#link-to 'user.edit' user.id}}\n      {{t 'user.profile.edit'}}\n    {{/link-to}}\n  </li>\n  <li role=\"presentation\" class=\"active\">\n    {{#link-to 'user.privacity' user.id}}\n      {{t 'Privacity'}}\n    {{/link-to}}\n  </li>\n</ul>\n<div class=\"tab-content\">\n\n<form  method=\"post\">\n  <table class=\"table\">\n    <thead>\n      <tr>\n        <th>{{t 'user.privacity.fieldName'}}</th>\n        <th>{{t 'Privacity'}}</th>\n      </tr>\n    </thead>\n    <tbody>\n      {{#each publicFields}}\n        <tr>\n          <td>{{t this}}</td>\n          <td>Public</td>\n        </tr>\n      {{/each}}\n      {{#each data}}\n        {{#ifCond @key 'metadata'}}\n        {{else}}\n          <tr>\n            <td>{{@key}}</td>\n            <td>\n              <select class=\"form-control\" name=\"{{@key}}\">\n                {{#ifCond record.privacity 'private'}}\n                  <option value=\"public\">{{t 'Public'}}</option>\n                  <option selected=\"selected\" value=\"private\">{{t 'Private'}}</option>\n                {{else}}\n                  <option selected=\"selected\" value=\"public\">{{t 'Public'}}</option>\n                  <option value=\"private\">{{t 'Private'}}</option>\n                {{/ifCond}}\n              </select>\n            </td>\n          </tr>\n        {{/ifCond}}\n      {{/each}}\n      <tr>\n        <td colspan=\"2\">\n          <button class=\"btn btn-primary\">Save</button>\n        </td>\n      </tr>\n    </tbody>\n  </table>\n</form>\n</div>\n",
