    "admin/role/find": "<ul class=\"nav nav-tabs\">\n  <li role=\"presentation\">\n    {{#link-to 'admin.user.find'}}{{t 'user.find'}}{{/link-to}}\n  </li>\n  <li role=\"presentation\" class=\"active\">\n    {{#link-to 'admin.role.find'}}{{t 'role.find'}}{{/link-to}}\n  </li>\n  <li role=\"presentation\">\n    {{#link-to 'permission_manage'}}{{t 'permission_manage'}}{{/link-to}}\n  </li>\n</ul>\n<br>\n\n<div class=\"actions\">\n  <form class=\"form form-inline\"action=\"{{req.path}}\" method=\"POST\">\n\n    <div class=\"form-group\">\n      <label>{{t 'role.create'}}</label>\n      <input class=\"form-control\" type=\"text\" name=\"name\">\n    </div>\n    <input type=\"hidden\" name=\"redirectTo\" value=\"{{req.path}}\">\n\n    <button class=\"btn btn-default\" type=\"submit\" name=\"action\" value=\"create\">{{t 'create'}}</button>\n  </form>\n</div>\n<table class=\"table table-striped table-hover\">\n  <thead>\n    <tr>\n      <th>{{t 'name'}}</th>\n      <th>{{t 'actions'}}</th>\n    </tr>\n  </thead>\n  <tbody>\n  {{#each data}}\n    <tr>\n      <td>{{name}}</td>\n      <td>\n        <form class=\"form form-inline\"action=\"{{../req.path}}\" method=\"POST\">\n          <input type=\"hidden\" name=\"name\" value=\"{{name}}\">\n          <input type=\"hidden\" name=\"redirectTo\" value=\"{{../req.path}}\">\n          <button onclick=\"return confirm('{{t 'role.delete.confirm.msg'}}');\" class=\"btn btn-default\" type=\"submit\" name=\"action\" value=\"delete\">{{t 'delete'}}</button>\n        </form>\n      </td>\n    </tr>\n  {{/each}}\n\n  </tbody>\n</table>",
    "components-core": "{{#can permission='manage_widget' roleNames=req.userRoleNames}}\n{{!-- sort widget modal --}}\n<div aria-hidden=\"true\" class=\"modal\" id=\"sortWidgetFormModal\"><div class=\"modal-dialog modal-lg\"><div class=\"modal-content\"><div class=\"modal-header\"><button aria-hidden=\"true\" data-dismiss=\"modal\" class=\"close\" type=\"button\">Ã—</button><h4 class=\"modal-title\">{{t 'widget.sort'}}</h4></div><div class=\"modal-body\"></div></div></div></div>\n{{!-- update widget modal --}}\n<div aria-hidden=\"true\" class=\"modal\" id=\"updateWidgetFormModal\"><div class=\"modal-dialog modal-lg\"><div class=\"modal-content\"><div class=\"modal-header\"><button aria-hidden=\"true\" data-dismiss=\"modal\" class=\"close\" type=\"button\">Ã—</button><h4 class=\"modal-title\">{{t 'widget.update'}}</h4></div><div class=\"modal-body\"></div></div></div></div>\n{{!-- add widget form modal --}}\n<div aria-hidden=\"true\" class=\"modal\" id=\"AddWidgetFormModal\">\n<form>\n  <div class=\"modal-dialog modal-lg\">\n    <div class=\"modal-content\">\n      <div class=\"modal-header\">\n        <button aria-hidden=\"true\" data-dismiss=\"modal\" class=\"close\" type=\"button\">Ã—</button><h4 class=\"modal-title\">{{t 'widget.add'}}</h4>\n      </div>\n      <div class=\"modal-body\">\n        <div class=\"steps-body\">\n          <div class=\"step1\">\n            <div class=\"form-group\">\n              <label>{{t 'layout.select.widget.type'}}</label>\n              <select id=\"AddWidgetFormModal-select-type\" name=\"type\" class=\"form-control\">\n                <option value=\"\"></option>\n              </select>\n            </div>\n            <div class=\"clearfix\"></div><hr>\n            <div class=\"form-group\">\n              <button type=\"button\" class=\"btn btn-primary\" onclick=\"we.structure.goToStep2();\"><i class=\"glyphicon glyphicon-step-forward\"></i> {{t 'Next'}}</button>\n            </div>\n          </div>\n          <div class=\"step2\"></div>\n        </div>\n      </div>\n    </div>\n  </div>\n</form>\n</div>\n{{/can}}\n<div class=\"system-actions\">\n  {{#can permission='manage_widget' roleNames=req.userRoleNames}}\n  <div class=\"we-layout-edit-btn\">\n    <button id=\"we-layout-start-edit-btn\" onclick=\"we.structure.showLayoutEditor();\" type=\"button\" class=\"btn btn-default btn-sm\"><i class=\"glyphicon glyphicon-edit text-info\"></i> {{t 'layout.edit.btn'}}</button>\n    <button id=\"we-layout-stop-edit-btn\" style=\"display:none;\" onclick=\"we.structure.hideLayoutEditor();\" type=\"button\" class=\"btn btn-default btn-sm\"><i class=\"glyphicon glyphicon-check text-success\"></i> {{t 'layout.edit.hide.btn'}}</button>\n  </div>\n  {{/can}}\n  {{#can permission='access_admin' roleNames=req.userRoleNames}}\n  <div class=\"we-admin-btn\">\n    <a href=\"/admin\" class=\"btn btn-default btn-sm\"><span class=\"glyphicon glyphicon-cog\"></span></a>\n  </div>\n  {{/can}}\n</div>",
    "default-layout": "{{#region 'highlighted' class=\"col col-md-12\"}}{{/region}}\n\n{{{body}}}",
