    "paginate": "<nav>\n  <ul class=\"pagination\">\n    {{#if previus}}\n      <li><a href=\"{{{previus.p}}}\" aria-label=\"Previous\">\n        <span aria-hidden=\"true\">&laquo;</span>\n      </a></li>\n    {{/if}}\n    {{#if haveMoreBefore}}\n      <li><a href=\"{{{first.p}}}\">\n        <span>{{{first.n}}}</span>\n      </a></li>\n      <li class=\"paginate-have-more-before disabled\">\n        <span>...</span>\n      </a></li>\n    {{/if}}\n    {{#each links}}\n      <li {{#if active}}class=\"active\"{{/if}}><a href=\"{{{p}}}\">{{{n}}}</a></li>\n    {{/each}}\n    {{#if haveMoreAfter}}\n      <li class=\"paginate-have-more-after disabled\"><a>\n        <span>...</span>\n      </a></li>\n      <li><a href=\"{{{last.p}}}\">\n        <span>{{{last.n}}}</span>\n      </a></li>\n    {{/if}}\n    {{#if next}}\n      <li><a href=\"{{{next.p}}}\" aria-label=\"Next\">\n        <span aria-hidden=\"true\">&raquo;</span>\n      </a></li>\n    {{/if}}\n  </ul>\n</nav>",
