    "admin/theme/index": "<table class=\"table\">\n  <thead>\n    <tr>\n      <th>{{t 'name'}}</th>\n      <th>Load as</th>\n      <th>{{t 'version'}}</th>\n      <th>{{t 'actions'}}</th>\n    </tr>\n  </thead>\n  <tbody>\n    {{#each themes}}\n      <tr>\n        <td>{{name}}</td>\n        <td>\n          {{#ifCond name ../themeConfigs.app}}\n            <span class=\"label label-success\">app</span>\n          {{/ifCond}}\n          {{#ifCond name ../themeConfigs.admin}}\n            <span class=\"label label-warning\">admin</span>\n          {{/ifCond}}\n        </td>\n        <td>{{version}}</td>\n        <td></td>\n      </tr>\n    {{/each}}\n  </tbody>\n</table>\n{{!--\n\n<form method=\"get\">\n  <h3>Search and install:</h3>\n  <div class=\"form-group\" >\n    <label for=\"findNewTheme\">Theme name:</label>\n    <input type=\"text\" class=\"form-control\" id=\"findNewTheme\" name=\"findNew\" value=\"{{req.query.findNew}}\">\n  </div>\n</form>\n\n{{#if searchedThemeInfo}}\n  <h4>{{req.query.findNew}} info:</h4>\n  <pre>{{searchedThemeInfo}}</pre>\n  <form method='post'>\n    <input type=\"hidden\" name=\"redirectTo\" value=\"{{req.url}}\">\n    <input type=\"hidden\" name=\"type\" value=\"theme\">\n    <input type=\"hidden\" name=\"name\" value=\"{{req.query.findNew}}\">\n    <div class=\"form-group\">\n      <button class=\"btn btn-primary\">Install</button>\n    </div>\n  </form>\n{{/if}}\n\n{{#if searchedThemeNotFound}}\n  <p>Not found</p>\n{{/if}} --}}",
    "menu/find": "<div class=\"actions\">\n{{we-action-create-btn resourceName req}}\n</div>\n<table class=\"table table-striped table-hover\">\n  <thead>\n    <tr>\n      <th>ID</th>\n      <th>{{t 'name'}}</th>\n      <th>{{t 'actions'}}</th>\n    </tr>\n  </thead>\n  <tbody>\n\n  {{#each data}}\n    <tr>\n      <td>{{id}}</td>\n      <td>{{name}}</td>\n      <td>\n        {{we-action-view-btn ../resourceName this ../req id}}\n        {{we-action-edit-btn ../resourceName this ../req id}}\n        {{we-action-delete-btn ../resourceName this ../req id}}\n      </td>\n    </tr>\n  {{/each}}\n\n  </tbody>\n  <tfoot>\n    <td colspan=\"3\">\n    </td>\n  </tfoot>\n</table>",
    "menu/findOne": "<table class=\"table table-striped table-hover\">\n  <tbody>\n    <tr>\n      <th>ID</th>\n      <td>{{data.id}}</td>\n    </tr>\n    <tr>\n      <th>{{t 'name'}}</th>\n      <td>{{data.name}}</td>\n    </tr>\n    <tr>\n      <th>class</th>\n      <td>{{data.class}}</td>\n    </tr>\n  </tbody>\n  <tfoot>\n    <td colspan=\"2\">\n      {{we-action-edit-btn resourceName data req data.id}}\n      {{we-action-delete-btn resourceName data req data.id}}\n    </td>\n  </tfoot>\n</table>\n\n<h3>{{t 'Links'}}</h3>\n<div class=\"row\">\n  <div class=\"col-lg-12 actions\">\n    {{we-action-create-btn 'link' req data.id}}\n  </div>\n  <div class=\"col-lg-12\">\n    <form class=\"linkOrderForm\" action=\"/admin/menu/{{data.id}}/sort-links\" method=\"POST\">\n      {{#tabledrag id='linkTable' menu=data}}\n        <tr class=\"draggable\">\n          <td>{{tabledrag-indentation depth=depth}}\n            {{{text}}}\n            <input class=\"id\" name=\"link-{{id}}-id\" value=\"{{id}}\" type=\"hidden\" />\n            <input class=\"row-depth\" name=\"link-{{id}}-depth\" value=\"{{depth}}\" type=\"hidden\" />\n          </td>\n          <td>\n            <input class=\"row-weight\" name=\"link-{{id}}-weight\" type=\"text\" value=\"{{weight}}\">\n          </td>\n          <td>\n            <input class=\"row-parent\" name=\"link-{{id}}-parent\" type=\"text\" value=\"{{parent}}\">\n          </td>\n          <td>\n            {{we-action-edit-btn 'link' this ../req menuId id}}\n            {{we-action-delete-btn 'link' this ../req menuId id}}\n          </td>\n        </tr>\n      {{/tabledrag}}\n\n      <div class=\"actions\">\n        <button class=\"btn btn-primary\">{{t 'order.save.btn'}}</button>\n      </div>\n      <input name=\"redirectTo\" type=\"hidden\" value=\"{{req.url}}\">\n    </form>\n  </div>\n</div>",
    "menu/link": "link.hbs",
    "menu/submenu-dropdown": "<li class=\"dropdown\">\n  {{#with submenu}}\n    <a aria-expanded=\"false\" aria-haspopup=\"true\" role=\"button\" data-toggle=\"dropdown\" class=\"dropdown-toggle\" href=\"#\"> {{{text}}} <span class=\"caret\"></span></a>\n  {{/with}}\n  <ul class=\"dropdown-menu\">{{{linksHTML}}}</ul>\n</li>\n\n",
    "menu/submenu": "<li class=\"li-submenu {{#if active}}active{{/if}}\">\n  {{#with submenu}}\n    <a {{#if href}}href=\"{{href}}\"{{/if}} {{#if title}}title=\"{{title}}\"{{/if}} {{#if class}}class=\"{{class}}\"{{/if}} style=\"{{style}}\" target=\"{{target}}\" rel=\"{{rel}}\">\n      {{{text}}}\n      {{#if ../active}}\n        <i class=\"pull-right glyphicon glyphicon-chevron-down\"></i>\n      {{else}}\n        <i class=\"pull-right glyphicon glyphicon-menu-hamburger\"></i>\n      {{/if}}\n    </a>\n  {{/with}}\n  <ul class=\"submenu nav nav-pills nav-stacked\">{{{linksHTML}}}</ul>\n</li>",
